                        Госдума в третьем, окончательном чтении приняла закон о федеральном бюджете на 2021–2023 годы.


Основные параметры бюджета:



	2021 год — доходы: 18,8 трлн рублей, расходы: 21,52 трлн рублей;
	2022 год — доходы: 20,6 трлн рублей, расходы: 21,88 трлн рублей;
	2023 год — доходы: 22,3 трлн рублей, расходы: 23,67 трлн рублей.


После обвала бюджетных доходов и рекордных трат в 2020 году Минфин начнет сокращение дефицита в 2021 году. По плану следующий год должен стать переходным: доходы казны еще  ...
